import React from 'react'
import { Link } from 'react-router-dom'
import {Heading} from 'grommet'

function Navbar () {

    return(
      <div>
        <ul >
        <li ><Link style={{ textDecoration: 'none', color: 'white' }} to="/">Home</Link></li>
        <li><Link style={{ textDecoration: 'none', color: 'white' }} to="/books">Books</Link></li>
        </ul>
        <Heading margin="none" size="Small"><Link style={{ textDecoration: 'none', color: 'white' }} to="/">Home</Link></Heading>
        <Heading margin="none"><Link style={{ textDecoration: 'none', color: 'white' }} to="/books">Books</Link></Heading>
      </div>
    )
}

export default Navbar;
